import React, { Component } from 'react';
import PropTypes from 'prop-types';


class cardDT extends Component {
    static propTypes = {
        dt: PropTypes.string.isRequired,
      }; 
    render() {
        const { dt } = this.props;
        return (
        <span className="carddatetime">{dt}</span>
        );
    }
}

export default cardDT;
